INSERT INTO `about` VALUES (1, '秋枫阁', 'Maple | Zoe', 'PHP工程师、web开发', '秋枫阁,Blog,博客,个人博客', '秋枫阁，是一个PHPer记录生活点滴，学习之路的个人网站。', '一个90后草根程序猿！2015年入行。一直潜心研究web后端技术，一边工作一边积累经验，分享一些个人笔记，以及开发经验等心得。', '<p>这是一篇关于我的文章。其中包含我的简介，联系方式等等。</p>', 'Maple-tea', '/images/wx.jpeg', 928046320, 'kfbb520@163.com', 1, '2018-05-30 14:30:30', '2018-05-30 14:30:30');
